import React from "react";
import { Container,Card, Col } from "react-bootstrap";

const Catigories = () => {
    return(
        <Col xs={6} sm={6} md={4} lg={3} className="my-1">
            <Link to={`/movie/${mov.id}`}>
                <div className="card">
                    <img src={`https://image.tmdb.org/t/p/w500/`+ mov.poster_path} className="card__image" alt="hu"/>
                    <div className="card__overlay ">
                        <div className="overlay__text text-center w-100 p-2">
                            <p>Film Title : {mov.original_title}</p>
                            <p>Film Date : {mov.release_date}</p>
                            <p>Number of Rate : {mov.vote_count}</p>
                            <p>Film Rate : {mov.vote_average}</p>
                        </div>
                    </div>
                </div>
            </Link>
        </Col>
    )
}
export default Catigories;
